       })
    }
  render() {
      const{tasks,stageName}=this.props
      console.log(tasks)
    return (
      <div name='Stage'>
       <h4>{stageName}</h4>
       {<Tasks tasks={tasks}/>}

       <button>Add Task</button>
      </div>
    );
  }
}

export default Stage;
